import React from 'react';
import ReactDOM from 'react-dom';
import CytoscapeComponent from 'react-cytoscapejs';
import Immutable from 'immutable';

class CytoContainer extends React.Component {
  constructor(props){
    super(props);
  }

  render(){
    //const elements = this.props.cy_data;
    const elements = this.props.cy_data
    const style = {style:[
            {   selector: "node", 
                style: {
                    "content": "data(content)",
                    "text-opacity": 0.7,
                    "width" : "auto",
                    "height" : "auto",
                    "text-valign": "bottom",
                    "text-halign": "right",
                    "text-outline-color": "#eee",
                    "text-outline-width": 1
              }
            },
            {   selector: "[typeshape]", 
                style: {
                    "shape":"data(typeshape)"
                }
            },
            {   selector: "node[typeshape='diamond']", 
                style: {
                    'background-color': '#CC9900'
                }
            },
            {
                selector: "node[typeshape='diamond'][content='Conflict']",
                style: {
                    'background-color': 'red'
                }
            },
            {
                selector: "node[typeshape='diamond'][content='Support']",
                style: {
                    'background-color': 'green'
                }
            },
            {   selector: "edge", 
                style: {
                    "line-color": "#9dbaea",
                    "target-arrow-shape": "triangle",
                    "target-arrow-color": "#9dbaea",
                    "curve-style": "bezier"
                }
            },
            {   selector: ":selected", 
                style: {
                    "border-width":"1",
                    "border-color":"black",
                    "background-color": "#3399CC"
                }
            },
            {   selector: ".atom-label", 
                style:{
                    "text-wrap": "wrap",
                    "text-max-width": 160
                }
            },
            {   selector: ".scheme-label", 
                style:{
                    "text-wrap": "wrap",
                    "text-max-width": 160
                }
            }
            ]}

    return (
<CytoscapeComponent
  elements={CytoscapeComponent.normalizeElements(elements)}
  style={ style }
/>
);  }
}

export default CytoContainer;
